import React from "react";
import Common from "./Common";
const Home = () => {
  return (
    <container>
      <Common
        title="Grow your knowledge with"
        subTitle="  We are the team of talented developers in the making of websites"
        btnName="Getting Started"
        btnLink="/service"
      />
    </container>
  );
};

export default Home;
